const GeoIcon = "data:image/png;base64,"

let smartMinLo = 0;
let smartMinLa = 0;
let smartMaxLo = 0;
let smartMaxLa = 0;
let smartAC = 0;
let disAC = 0;
function update(){
  navigator.geolocation.getCurrentPosition(function(e){window.lo = e.coords.longitude; window.la = e.coords.latitude; window.ac = e.coords.accuracy;});
};

function distanceBetween(lo1, la1, lo2, la2){

  return Math.sqrt((lo1-lo2)*(lo1-lo2) + (la1-la2)*(la1-la2));
};
function convertCoordinatesToMetres(coordinates){
  return coordinates*111000;
};

function convertMetresToCoordinates(metres){
  return metres/111000;
};

    function loop(){
        update()


            if(window.lo > smartMinLo && window.lo < smartMaxLo && window.la > smartMinLa && window.la < smartMaxLa){
                if(window.ac < smartAC){
                    
                    smartMinLo = window.lo - window.ac
                    smartMinLa = window.la - window.ac
                    smartMaxLo = window.lo + window.ac
                    smartMaxLa = window.la = window.ac
                    smartAC = window.ac
                    disAC = window.ac
                }else{
                    window.lo = smartMinLo + smartAC
                    window.la = smartMinLa + smartAC
                    disAC = smartAC
                }
            }else{
            smartMinLo = window.lo - window.ac
            smartMinLa = window.la - window.ac
            smartMaxLo = window.lo + window.ac
            smartMaxLa = window.la + window.ac
            smartAC = window.ac
            disAC = window.ac
            };
            

        
        setTimeout(loop, 1000);
    };
    loop();

class GeoLocation {
    constructor(runtime) {
        this.runtime = runtime
    }

    getInfo() {
        return {
            "id": "GeoLocation",
            "name": "Geo Location",
          
             "menuIconURI": GeoIcon,
             "blockIconURI": GeoIcon,
          
            "blocks": [
                {
                    "opcode": "getLongitude",
                    "blockType": "reporter",
                    "text": "Current Longitude",
                },
                {
                    "opcode": "getLatitude",
                    "blockType": "reporter",
                    "text": "Current Latitude",
                },
                {
                    "opcode": "getAccuracy",
                    "blockType": "reporter",
                    "text": "Current Accuracy",
                },
                {
                    "opcode": "coordinatesToMetres",
                    "blockType": "reporter",
                    "text": "Coordinates: [coordinates] in Metres",
                    "arguments": {
                        "coordinates": {
                            "type": "number",
                            "defaultValue": "51.5"
                        },
                    },
                },
                {
                    "opcode": "metresToCoordinates",
                    "blockType": "reporter",
                    "text": "Metres: [metres] in Coordinates",
                    "arguments": {
                        "metres": {
                            "type": "number",
                            "defaultValue": "5717277"
                        },
                    },
                },
                {
                    "opcode": "coordinateDistance",
                    "blockType": "reporter",
                    "text": "Distance From Longitude: [longitude1] Latitude: [latitude1] to Longitude: [longitude2] Latitude: [latitude2]",
                    "arguments": {
                        "longitude1": {
                            "type": "number",
                            "defaultValue": "51.5"
                        },

                        "latitude1": {
                            "type": "number",
                            "defaultValue": "0"
                        },


                        "longitude2": {
                            "type": "number",
                            "defaultValue": "56"
                        },

                        "latitude2": {
                            "type": "number",
                            "defaultValue": "3.1"
                        },
                    },
                },
            ],
    
        };
    }

getLongitude() {
  return window.lo;
}

getLatitude() {
  return window.la;
    }
    
getAccuracy() {
  return disAC;
}
  
  coordinatesToMetres({coordinates}){
    return convertCoordinatesToMetres(coordinates);
  }
  
  metresToCoordinates({metres}){
    return convertMetresToCoordinates(metres);
  };
  
  coordinateDistance({longitude1, latitude1, longitude2, latitude2}){
    return distanceBetween(parseFloat(longitude1), parseFloat(latitude1), parseFloat(longitude2), parseFloat(latitude2))
  }
}

(function() {
    var extensionInstance = new GeoLocation(window.vm.extensionManager.runtime)
    var serviceName = window.vm.extensionManager._registerInternalExtension(extensionInstance)
    window.vm.extensionManager._loadedExtensions.set(extensionInstance.getInfo().id, serviceName)
})()
